import React, { useEffect, useState } from 'react';
import axios from 'axios';

function Dashboard() {
  const [bots, setBots] = useState([]);

  useEffect(() => {
    // Fetch bots from backend (dummy performance data can be added here)
    axios.get('http://localhost:5000/api/bots')
      .then(response => {
        setBots(response.data);
      })
      .catch(error => {
        console.error("Error fetching bots:", error);
      });
  }, []);

  return (
    <div>
      <h2>Dashboard</h2>
      <p>Below is a list of bots and their current (dummy) performance metrics:</p>
      <ul>
        {bots.map(bot => (
          <li key={bot.id}>
            <strong>{bot.bot_name}</strong> - Trade type: {bot.trade_type}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Dashboard;
